// FUNCIÃ“N ESPECÃFICA PARA MAPFRE: Detectar transmisiÃ³n
function detectarTransmisionMapfre(versionCompleta, versionCorta) {
    const textoCompleto = `${versionCompleta || ''} ${versionCorta || ''}`.toUpperCase();

    // Patrones especÃ­ficos de MAPFRE
    const patronesManual = [
        /\bTM\b/,      // TM solo
        /\bMT\b/,      // MT solo
        /\bMANUAL\b/,  // MANUAL
        /\bSTD\b/,     // STD
        /\b5MT\b/,     // 5MT
        /\b6MT\b/      // 6MT
    ];

    const patronesAuto = [
        /\bTA\b/,      // TA solo
        /\bAT\b/,      // AT solo
        /\bAUT\b/,     // AUT
        /\bAUTO\b/,    // AUTO
        /\bCVT\b/,     // CVT
        /\bDCT\b/,     // DCT
        /\bDSG\b/,     // DSG
        /\bTIPTRONIC/, // TIPTRONIC
        /\bSTRONIC/    // STRONIC
    ];

    // Verificar manual
    const tieneManual = patronesManual.some(patron => patron.test(textoCompleto));
    const tieneAuto = patronesAuto.some(patron => patron.test(textoCompleto));

    if (tieneManual && !tieneAuto) {
        return 'MANUAL';
    }
    if (tieneAuto && !tieneManual) {
        return 'AUTO';
    }

    return 'NO_ESPECIFICADA';
}

// FunciÃ³n para normalizar transmisiÃ³n
function normalizarTransmision(transmisionDesc, transmisionCodigo, versionCompleta, versionCorta) {
    // Si tiene cÃ³digo confiable (1 o 2), usarlo
    if (transmisionCodigo === 1) return 'MANUAL';
    if (transmisionCodigo === 2) return 'AUTO';

    // Si hay descripciÃ³n vÃ¡lida
    if (transmisionDesc && transmisionDesc !== 'No especificada') {
        return MAPA_TRANSMISIONES[transmisionDesc] || 'NO_ESPECIFICADA';
    }

    // Para MAPFRE: Intentar detectar desde las descripciones
    const transmisionDetectada = detectarTransmisionMapfre(versionCompleta, versionCorta);

    return transmisionDetectada;
}

// FunciÃ³n para generar hash Ãºnico
function generarHash(...componentes) {
    const textoHash = componentes
        .map(c => String(c || '').toUpperCase().trim())
        .filter(c => c !== '' && c !== 'MODELO_DESCONOCIDO' && c !== 'MARCA_DESCONOCIDA')
        .join('|');

    if (textoHash === '') {
        return crypto
            .createHash('sha256')
            .update(`EMPTY_${Date.now()}_${Math.random()}`, 'utf8')
            .digest('hex');
    }

    return crypto
        .createHash('sha256')
        .update(textoHash, 'utf8')
        .digest('hex');
}

